A story about a young girl who is the daughter a prominent doctor. When the girl goes missing her father gets the police to jump into action because of his class status.

A teenage girl from a wealthy family mysteriously disappears. After her body is found at the bottom of a lake the police begin an intense investigation that leads to a teenage prostitution ring and several more bloody murders.

